		"1235": "respice in me et miserere mei domine quoniam unicus et pauper sum ego vide humilitatem meam et laborem meum et dimitte omnia peccata mea deus meus ad te domine levavi animam meam deus meus in te confido non erubescam gloria patri e u o u a e",
