		"55": "probasti nos deus igne nos examinasti sicut examinatur argentum induxisti nos in laqueum posuisti tribulationes in dorso nostro imposuisti homines super capita nostra transivimus per ignem et aquam et eduxisti nos in refrigerium",
		"56": "ego sum radix et genus david stella splendida et matutina et spiritus et sponsa dicunt veni et qui audit dicat veni et qui sitit veniat et qui vult accipiat aquam vitæ gratis",
