		"92": "magnificentiam gloriæ sanctitatis tuæ domine loquentur et mirabilia tua narrabunt et virtutem terribilium tuorum dicent et magnitudinem tuam narrabunt memoriam abundantiæ suavitatis tuæ eructabunt et justitia tua exsultabunt",
		"110": "apud dominum gressus hominis dirigentur et viam ejus volet os justi meditabitur sapientiam et lingua ejus loquetur judicium lex dei ejus in corde ipsius et non supplantabuntur gressus ejus",
		"114": "adoramus te christe et benedicimus tibi quia per crucem tuam redemisti mundum tuam crucem adoramus domine tuam gloriosam recolimus passionem miserere nostri qui passus es pro nobis o crux benedicta quæ sola fuisti digna portate regem cælorum et dominum",
