		"250": "fortitudo mea et laus mea dominus et factus est mihi in salutem iste deus meus et glorificabo eum dominus quasi vir pugnator omnipotens nomen ejus dominus conterens bella dominus nomen est illi",
		"256": "veni sponsa christi accipe coronam quam tibi dominus præparavit in æternum pro cujus amore sanguinem tuum fudisti dilexisti justitiam et odisti iniquitatem propterea unxit te deus deus tuus oleo lætitiæ præ consortibus tuis specie tua et pulchritudine tua intende prospere procede et regna",
		"266": "ave maria gratia plena dominus tecum benedicta tu in mulieribus et benedictus fructus ventris tui ecce concipies et paries filium et vocabis nomen ejus emmanuel quomodo inquit fiet istud quoniam virum non cognosco et respondens angelus dixit ei spiritus sanctus superveniet in te et virtus altissimi obumbrabit tibi ideoque quod nascetur ex te sanctum vocabitur filius dei",
